import React from 'react';

import DependentTable from "../../components/admin/tables/DependentTable";

export default function DependentView(){
    return(
        <>
                <div className="row">
                    <div className="col-lg-12">
                        <h5 className="view-header">Dependents</h5>
                    </div>
                </div>
                <div className="row">
                    <div className="col-lg-12">
                        <DependentTable/>
                    </div>
                </div>
        </>
    );
}
